import React, { useState } from "react";
import styles from "./body.module.css";
import Img1 from '../../img/Img1Wix.webp';

function Body() {

  const conteudo1P1 = "01";
  const conteudo1P2 = "10% de Desconto com o cupom: vg123";
  const conteudo2 = "02 / Descontos em compras acima de R$200";
  const conteudo3 = "03 / A primeira consulta é por nossa conta";

  return (
    <div className={styles.body}>
      <div className={styles.imgContent}>
        <img src={Img1} className={styles.imgBody} />
        <div className={styles.contentImg1}>
          <p className={styles.contentP1Text}>
            {`${conteudo1P1}`}
          </p>
          <p className={styles.contentP2Text}>
            {"/"}
          </p>
          <p className={styles.contentP3Text}>
            {`${conteudo1P2}`}
          </p>
          <p className={styles.contentButton}>
            Comprar
          </p>
        </div>
      </div>
    </div>
  );
}

export default Body;
